### The problem
Consider a simple Resource 'class' with a custom method added to the prototype:
```js
var User = $resource('/user/:userId', {userId:'@id'});
User.prototype.sayHello = function(){};
```
Then this will work:
```js
var user = new User();
user.sayHi();
```
But when one or more instances are retrieved using `.get()` or `.query()`, the wrong constructor is used, causing this functionality to break:
```js
// When using .get()
var user = User.get({userId:123}, function() {
    user.sayHi(); // This will not work
});

// When using .query()
users = User.query(function(){
    var user = users[0];
    user.sayHi(); // This will not work
});
```
This is a result of instantiating the new resource instances directly from the `Resource` constructor defined in the `resourceFactory()` function and not the constructor of the current Resource 'class'.

### The fix

This PR makes sure the correct constructor is used and the prototype is chained correctly if resource instances are created by `.get()` or `.query()`.

```js
// When using .get()
var user = User.get({userId:123}, function() {
    user.sayHi(); // This will now work as expected
});

// When using .query()
users = User.query(function(){
    var user = users[0];
    user.sayHi(); // This will now work as expected
});
```
This PR replaces and extends #5168 in that it now also includes support for objects instantiated by `query()` and is using a newer version of `ngResource`.

Allows to use orderBy filter on collection objects and not only arrays.

eg:

	var c = {
		b: {name: 'b'},
		c: {name: 'c'},
		a: {name: 'a'}
	};
	orderBy(c, 'name'); // => [{name: 'a'}, {name: 'b'}, {name: 'c'}];

Closes: #6210

Adds an option to $cacheFactory to define the expiration of a key after a given amount of elapsed milliseconds.

The change additionally alters the defaultCache for $http so that it can be configured during the run phase.

----

I'd like to discuss about this feature being implemented into the AngularJS core. I know there are more powerful cache factories out there and the cache factory of AngularJS should be simple and lightweight. However, for requests to a REST API it should be possible to automatically invalidate the results after a given amount of time, while everything is still simple and lightweight. So I added this small amount of code to the `$cacheFactory`.

Tests for the change in `src/ng/http.js` are missing since I don't know how to test this properly. Hopefully someone can tell me how this could be achieved or point me to the right direction and I'll add a test for that, too.  The change has been implemented so one can configure the `defaultCache` with a `maxAge` as follows:

```javascript
'use strict';

angular.module('app', [
    'ngResource'
])
.run(["$cacheFactory", function($cacheFactory) {
    $cacheFactory('$http', { maxAge: 10000 });
}]);
```

